import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';
import { TransitionGroup, CSSTransition } from 'react-transition-group';
//transition group - part of landing page feature 1 from figma

//the following code was from the figma design file
const App = () => {
  const [isVisible, setVisible] = useState(false);

  return (
    <TransitionGroup>
      {isVisible && (
        <CSSTransition
          in={isVisible}
          timeout={3000}
          classNames="iphone-14-pro-max-2"
        >
          <div>
            <h1>iPhone 14 Pro Max</h1>
            <p>The most advanced iPhone yet.</p>
          </div>
          <div style={{width: '100%', height: '100%', transform: 'rotate(180deg)', transformOrigin: '0 0', color: 'black', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>
            VEGA FOR HOME GROWERS
          </div>
        </CSSTransition>
      )}
    </TransitionGroup>
  );
};

export default App;
